export class Cliente {
  code: number = 0;
  name: string = '';
  age: number = 0;
  city: string = '';
  private _number: number = 0;

  get number(): number {
    return this._number;
  }

  set number(value: number) {
    const isNumberValid = /^[0-9]{11}$/.test(value.toString());

    if (isNumberValid) {
      this._number = value;
    } else {
      console.error('O número deve ter exatamente 11 dígitos.');
    }
  }
}
